export default function About() {
	const authorLink = (
		<a
			href="https://levesque.dev"
			target="_blank"
		>
			Christian LeVesque
		</a>
	);

	return (
		<>
			<Typography
				typography="h1"
				component="h1"
				mb={4}
			>
				About Sienar
			</Typography>
			<Typography mb={4}>
				Sienar is an application development framework created and developed by {authorLink} that aims to create an opinionated approach to addressing the most common needs of many applications.
			</Typography>

			<Typography mb={4}>
				Sienar leverages several open source libraries. It's not possible to list <em>all</em> the libraries Sienar uses because of how intertwined open source software is, but the following is a list of libraries that Sienar <em>directly</em> relies on:
			</Typography>

			<Grid
				container
				spacing={2}
				justifyContent="stretch"
			>
				{technologies.map(t => (
					<Grid
						key={t.name}
						size={3}
					>
						<Stack
							component={Paper}
							direction='column'
							alignItems='center'
							elevation={1}
							p={2}
							sx={{ height: '100%' }}
						>
							<Icon sx={{
								height: 48,
								width: 48
							}}>
								{t.icon}
							</Icon>
							<Typography
								component={Link}
								href={t.link}
								typography='h6'
								mt={1}
								mb={2}
								underline='hover'
							>
								{t.name}
							</Typography>
							<Typography>
								{t.reason}
							</Typography>
						</Stack>
					</Grid>
				))}
			</Grid>
		</>
	);
}